import React from 'react';
import ReactDOM from 'react-dom/client';

//创建一个React元素
const App = <div>Hello React</div>;

//获取根元素
const root = ReactDOM.createRoot(document.getElementById('root'));

//渲染元素
root.render(
  <React.StrictMode>
    {App}
  </React.StrictMode>
);
